$dom->formatOutput = true;
$dom->preserveWhiteSpace = false;
$wServ = $dom->createElement("WS");
$wServ->setAttribute('xmlns:xsi', "http://www.w3.org/2001/XMLSchema-instance");

$oldDigla = '';
$oldAmbiente = '';
foreach ($ws as $webserv) {
    $sigla = $webserv['UF'];
    $ambiente = $webserv['Ambiente'];
    $servico = $webserv['Servico'];
    $versao = $webserv['Versao'];
    $url = $webserv['URL'];
    $metodo = $webserv['Metodo'];
    if ($sigla != $oldSigla) {
        $oldSigla = $sigla;
        if (isset($elAmb)) {
            $wsUF->appendChild($elAmb);
            $elAmb = null;
        }
        if (isset($wsUF)) {
            $wServ->appendChild($wsUF);
            $wsUF = null;
        }
        $wsUF = $dom->createElement('UF');
        $elSigla= $dom->createElement('sigla', $sigla);
        $wsUF->appendChild($elSigla);
    }
    
    if ($ambiente != $oldAmbiente) {
        $oldAmbiente = $ambiente;
        if (isset($elAmb)) {
            $wsUF->appendChild($elAmb);
            $elAmb = null;
        }
        $elAmb = $dom->createElement($ambiente);
    }
    $elServ = $dom->createElement($servico, $url);
    $elServ->setAttribute('method', $metodo);
    $elServ->setAttribute('version', $versao);
    $elAmb->appendChild($elServ);
}
